const ServicesMain = () => {
  return (
    <section className="bg-black text-white py-20 px-6">
      <div className="text-center max-w-4xl mx-auto">
        <h2 className="text-4xl font-bold text-yellow-300 mb-6">Our Services</h2>
        <p className="text-lg mb-4">
          Sign Galaxy offers end-to-end design and installation services across:
        </p>
        <ul className="list-disc text-left list-inside text-lg space-y-2">
          <li>Interior Design</li>
          <li>Exterior Design</li>
          <li>Signage & Branding</li>
        </ul>
      </div>
    </section>
  );
};

export default ServicesMain;
